            artTitle: "Radio School Opening Tomorrow Holds Opportunities For Fans",
            artSubtitle: "Morning Classes for Children and Evening Classes for Adults to Be Under Competent Teacher",
            artBody: "Officials in charge of the free radio school to be instituted by The Courier-Journal and The Louisville Times pointed out that everything was in readiness for the first class, which will be held at 10 o’clock tomorrow morning in Room 210 in The Courier-Journal and The Louisville Times Building, Third and Liberty Streets. The second class will be held Tuesday, and on each Tuesday and Thursday thereafter. The morning classes will be for children only and the night classes for adults. Admission to the morning classes will be by tickets, which children may obtain from any of the following substations of the two newspapers: 636 East Jefferson Street, 2213 Frankfort Avenue, 1020 Bardstown Road, 1769 Bardstown Road, 1217 Logan Street, 910 South Preston Street, 621 West Oak Street, 1921 South Fourth Street, 3106 South Fourth Street, 1738 Gallagher Street, 1219 South Twenty-eight Street, 3559 ½ Slevin Street. W. O. Porter of the Central Radio Company will conduct the first class, during which he will explain the simple crystal set and the installation of antenna. Experts from other radio supply houses in Louisville, through whose co-operation the school was made possible, also will be instructors in the school.",
